description:
About this item
Potencia fluida, rendimiento seguro; procesador Intel Core i3-14100 de 14.ª generación para multitarea eficiente en entornos profesionales; ideal para oficinas que requieren agilidad y fiabilidad constantes;
Memoria avanzada, respuesta instantánea; 16 GB DDR5 permiten abrir múltiples aplicaciones sin ralentizaciones; para usuarios que editan documentos, hojas de cálculo y navegan simultáneamente;
Almacenamiento veloz, espacio generoso; SSD NVMe 4.0 de 1 TB acelera el arranque y el acceso a archivos; recomendado para quienes gestionan grandes volúmenes de datos o proyectos multimedia;
Conectividad moderna, sin límites; Wi-Fi 6 y Bluetooth 5.2 facilitan la integración de dispositivos y redes rápidas; útil en despachos o salas de reuniones con múltiples conexiones inalámbricas;
Diseño compacto, eficiencia energética; formato Micro-ATX y Energy Star optimizan el espacio y el consumo; para puestos de trabajo reducidos o entornos que priorizan la sostenibilidad;
› See more product details
